ExprLine.OrigStr:
GenDeclareVar("RowData", "Mission");
GenSetEarlyOverrideInt(Self, "X", (RowData.Depth) * 17);
GenSetString(Self, "Mission", GetMissionUIString(Player, RowData));
GenSetString(Self, "MissionCount", GetMissionCountString(RowData));
if (GetMissionTimerString(RowData) = "")
	GenSetString(Self, "MissionTimer", "");
else
	GenSetString(Self, "MissionTimer", GetMissionTimerString(RowData));
endif
